import './App.css';
import Header from './components/Header';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import { Stack } from '@mui/system';
import AddIcon from '@mui/icons-material/Add';
import { useState } from 'react';

function App() {
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [data, setData] = useState([]);


  const addData = () => {
    setData([...data,{name,email}]);
    setName("");
    setEmail("");
  }

  return (
    <div className="App">
      <Header />
      <div className='form'>
        <Stack direction="row" spacing={2}>
          <TextField value={name} onChange={(event) => setName(event.target.value)} id="outlined-basic" label="name" variant="outlined" />
          <TextField  value={email} onChange={(event) => setEmail(event.target.value)}  id="outlined-basic" label="email" variant="outlined" />
          <Button onClick={addData} variant="contained" color='error'><AddIcon /></Button>
        </Stack>
      </div>

      {/* {Data} */}

      <div className='data'>
        <div className='data_val'>
              <h4>Name</h4>
              <h4>Email</h4>
              <h4>Remove</h4>
        </div>

      </div>
    </div >
  );
}

export default App;
